--TABLES
SET default_tablespace = ts_licpub_data;
SET default_with_oids = false;

--Se crea tabla partida_generica
CREATE TABLE if not exists licpub.partida_generica
(
    id_partida_generica integer NOT NULL,
    id_concepto integer NOT NULL,
    descripcion character varying(500) NOT NULL
)TABLESPACE ts_licpub_data;

ALTER TABLE licpub.partida_generica OWNER TO licpub;

SET default_tablespace = ts_licpub_idx;

ALTER TABLE licpub.partida_generica ADD CONSTRAINT partida_generica_pkey PRIMARY KEY (id_partida_generica)
	USING INDEX TABLESPACE ts_licpub_idx;

ALTER TABLE ONLY licpub.partida_generica
    ADD CONSTRAINT partida_generica_fk FOREIGN KEY (id_concepto)
    REFERENCES licpub.concepto(id_concepto) DEFERRABLE INITIALLY DEFERRED;

